import React from "react";
import SocialMediaIcons from "./socialIcons";

const SmallNav = () => {
  return (
    <nav className="d-none d-sm-flex justify-content-between align-items-center bg-primary container-fluid text-white shadow ">
      <div>
        <p className="m-0 p-0">
          <SocialMediaIcons sMedia="facebook" />
          <SocialMediaIcons sMedia="twitter" />
          <SocialMediaIcons sMedia="youtube" />
          <SocialMediaIcons sMedia="linkedin" />
        </p>
      </div>
      <div>
        <p className="m-0 p-0">
          <SocialMediaIcons sMedia="envelope-fill"></SocialMediaIcons>
          contact@oytechnology.com /
          <SocialMediaIcons sMedia="telephone-fill"></SocialMediaIcons>+91
          8285524418
        </p>
      </div>
    </nav>
  );
};

export default SmallNav;
